import base64
import mimetypes
import os
from google import genai
from google.genai import types
from dotenv import load_dotenv
from app.core.logger_config import setup_logger

load_dotenv()
logger = setup_logger(__name__)

def save_binary_file(file_name, data):
    f = open(file_name, "wb")
    f.write(data)
    f.close()
    print(f"File saved to to: {file_name}")

def generate(lista_imagens, prompt, filename_imagem, path_name, momentoChave):
    client = genai.Client(
        api_key="AIzaSyDUnkQyPkwB3VH5T6DlY1oz6RxoGtXYroA",
    )

    model = "gemini-2.0-flash-exp-image-generation"
    contents = [
        types.Content(
            role="user",
            parts=[
                types.Part.from_text(text=prompt),
            ],
        ),
        types.Content(
            role="model",
            parts=[
                types.Part.from_bytes(
                    mime_type="""image/png""",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
            ],
        ),
        types.Content(
            role="user",
            parts=[
                types.Part.from_text(text=prompt),
            ],
        ),
    ]
    
    generate_content_config = types.GenerateContentConfig(
        response_modalities=["image", "text"],
        response_mime_type="text/plain"
    )

    for chunk in client.models.generate_content_stream(
        model=model,
        contents=contents,
        config=generate_content_config,
    ):
        if (
            chunk.candidates is None
            or chunk.candidates[0].content is None
            or chunk.candidates[0].content.parts is None
        ):
            continue
        if chunk.candidates[0].content.parts[0].inline_data:
            file_name = filename_imagem
            inline_data = chunk.candidates[0].content.parts[0].inline_data
            data_buffer = inline_data.data
            file_extension = mimetypes.guess_extension(inline_data.mime_type)
            save_binary_file(path_name, data_buffer)

            lista_imagens.append({
                "nomeArquivo": filename_imagem,
                "momentoChave": momentoChave,
                "caminho": path_name
            })
            logger.info(f"lista_imagens dentro do if {lista_imagens}")
            return lista_imagens
        else:
            logger.info("lista_imagens vazia")
            logger.info(chunk.text)
            continue

